import React, {Component} from 'react';
import {LoginWrap, LoginBox} from './style';

class Login extends Component {
    render(){
        return (
            <LoginWrap>
                <LoginBox>
                    <Input placeholder="User Name"></Input>
                </LoginBox>
            </LoginWrap>
        )
    }
}

export default Login;
